import React from 'react';
import PropsTypes from 'prop-types';

const Navbar = props => {
    return (
        <nav className='navbar bg-primary'>
            <h1>
                <i className={props.icon} />
                {props.title}
            </h1>
        </nav>
        )
}

Navbar.defaultProps = {
    title: ' GitHub Finder ',
    icon: 'fab fa-github '
}

Navbar.propTypes = {
    title: PropsTypes.string.isRequired,
    icon: PropsTypes.string.isRequired
}

export default Navbar
